import { StyleSheet } from "react-native";


const styles = StyleSheet.create({
    sectionStyle: {
        flexDirection: 'row',
        justifyContent: 'center',
        alignItems: 'center',
        backgroundColor: "#D9D9D9",
        borderColor: '#000',
        height: 40,
        borderRadius: 5,
        paddingHorizontal: 5
    },
});

export default styles;
